pragma solidity ^0.8.0;

contract calculator {
    event Result(uint value);

    function addNum(uint num1, uint num2) public  returns (uint) {
        uint res = num1 + num2;
        emit Result(res);
        return res;
    }

    function subNum(uint num1, uint num2) public  returns (uint) {
        uint res = num1 - num2;
        emit Result(res);
        return res;
    }

    function mulNum(uint num1, uint num2) public  returns (uint) {
        uint res = num1 * num2;
        emit Result(res);
        return res;
    }

    function divNum(uint num1, uint num2) public  returns (uint) {
        require(num2 > 0, "Division by zero");
        require(num1 > num2, "num1 must be larger than num2");
        uint res = num1 / num2;
        emit Result(res);
        return res;
    }
}
